import { AppBar, Toolbar, Typography, Box, IconButton } from "@mui/material";
import { useState } from "react";
import fetchModel from "../../libs/fetchModelData";
import { Navigate, useNavigate } from "react-router-dom";

function TopBar(props) {
    const [user, setUser] = useState();
    const navigate = useNavigate();

    const handleLogout = async() => {
        const response = await fetchModel(`logout`, "POST");
        if (response.status === 200) {
            navigate(`/login-register`);
        }
    }
    if (props.loginUser) {
        return (
            <AppBar className="topbar-appBar" position="absolute">
                <Toolbar>
                <Typography variant="h5" color="inherit" sx={{ flexGrow: 1 }}>
                   Hi {props.loginUser.first_name} {props.loginUser.last_name}
                </Typography>
                <IconButton title="Log out" onClick={handleLogout} variant="contained">
                    {/* <ExitToApp style={{ color: "#ffffff", marginBottom:"8px" }} fontSize="small" /> */}
                    Logout
                </IconButton>
                {/* <Box sx={{ flexGrow: 0 }}>
                    <Typography variant="h6" color="inherit">
                    Photo sharing app
                    </Typography>
                </Box> */}
                </Toolbar>
            </AppBar>
        );
    } else {
        return (
            <AppBar className="topbar-appBar" position="absolute">
                <Toolbar>
                <Typography variant="h5" color="inherit" sx={{ flexGrow: 1 }}>
                    Your name
                </Typography>
                <Box sx={{ flexGrow: 0 }}>
                    <Typography variant="h6" color="inherit">
                    Photo sharing app
                    </Typography>
                </Box>
                </Toolbar>
            </AppBar>
            );
    }
}

export default TopBar;
